		"etymology": "History and Etymology for  venal  borrowed from Latin  v\u0113n\u0101lis  \"that may be bought, for sale,\" from  *v\u0113nus  \"sale\" (attested only in accusative  v\u0113num  and dative  v\u0113n\u014d, v\u0113nu\u012b ; akin to Greek  \u00f4nos  \"price,\" Sanskrit  vasna-  \"price, value\") +  -\u0101lis-al  entry  1",
		"examples": [
				"that judge is known for being  venal  and easily bought"
		],
		"notes": "Did You Know? If you are given the choice between acts that are \"venal\" and those that are \"venial,\" go for the venial. Although the two words look and sound alike, they have very different meanings and histories. \"Venal\" demonstrates the adage that anything can be had if the price is high enough and the morals are low enough. That word originated with the Latin  venum,  which simply referred to something that was sold or for sale. Some of those transactions must have been rather shady, because by the mid-1600s, \"venal\" had gained the sense of corruption it carries today. \"Venial\" sins, on the other hand, are pardonable, the kind that show that everyone makes mistakes sometimes. That forgiving term descends from \"venia,\" Latin for  favor,  \"indulgence,\" or \"pardon.\"",
