		"etymology": "History and Etymology for  virus  Middle English, \"pus, discharge from a sore, semen,\" borrowed from Latin  v\u012brus  (neuter) \"venom, poisonous fluid, acrid element in a substance, secretion with medical or magical properties,\" going back to an Indo-European base  *u\u032fis-/*u\u032f\u012bs-  \"poison, venom,\" whence also Middle Irish  f\u00ed  \"venom, poison, evil,\" Greek  \u012b\u00f3s  \"poison,\" Tocharian A  w\u00e4s  and Tocharhian B  wase,  Sanskrit  vi\u1e63\u00e1\u1e43,  Avestan  vi\u0161, vi\u0161a-  (also  v\u012b\u0161 ?); (sense 1) borrowed from German, borrowed from Latin Note:  The application of Latin  v\u012brus  to the submicroscopic infectious agents now considered viruses (rather than to any infectious agent) was apparently first made by the Dutch microbiologist Martinus Beijerinck (1851-1931) in \"Ueber ein Contagium vivum fluidum als Ursache der Fleckenkrankheit der Tabaksbl\u00e4tter,\"  Verhandelingen der Koninklijke Akademie van Wetenschappen te Amsterdam,  Tweede Sectie, Deel VI, no. 5 (1898). Beijerinck, in studying tobacco mosaic virus, mistakenly believed that the agent was a fluid ( contagium vivum fluidum , \"living fluid infection\") because it passed through filters capable of trapping bacteria. \u2014 The neuter gender of  v\u012brus  suggests that it was originally an s-stem; forms in text other than the nominative and accusative are perhaps found only in Lucretius. The length of the vowel in Latin, Irish, and Greek, in contrast to the short vowel in Tocharian and Indo-Iranian, has been variously accounted for. M. Mayrhofer ( Etymologisches W\u00f6rterbuch des Altindoarischen ) suggests that the etymon was originally a root noun,  *u\u032f\u012bs, *u\u032fis-\u00f3-,  with lengthening of the monosyllabic vowel; the daughter languages then generalized one or the other form.",
