		"examples": [],
		"notes": "Did You Know? Virga  is from the Latin word  virga,  which means primarily \"branch\" or \"rod,\" but can also refer to a streak in the sky suggesting rain. Our featured word, which dates to the mid-20th century, is only the latest in a series of words from this root. \"Verge\" (which originally referred to a rod or staff carried as an emblem of authority or a symbol of office) dates to the 15th century. The rare noun \"virgate,\" which refers to an old English unit of land area, came from \"virga\" by way of the Medieval Latin  virgata  (also a unit of land area) in the late 17th century. The more common adjective  virgate,  meaning \"shaped like a rod or wand\" arrived in the early 19th by way of Latin  virgatus,  meaning \"made of twigs.\"",
