		"etymology": "History and Etymology for  viol  Middle English  vial,  borrowed from Anglo-French  viel, viele, viole,  corresponding to continental Old French  viele  (by suffix substitution  vielle ) and  viole,  from a Gallo-Romance base  vi-,  attested earliest in Old Occitan  viola, viula  \"viol,\" of uncertain origin Note:  It has been claimed that the base  vi-  is of onomatopoeic origin, originally in verbal derivatives (Old French  vieller,  Old Occitan  violar  \"to play a stringed instrument\"), from which the noun designating the instrument is derived. However, it is unlikely that the resemblance between the  viola  words and Germanic  *fi\u00fel\u014d-  (whence Old High German  fidula,  Old English  *fi\u00f0ele ; see  fiddle  entry  1 ), a noun probably designating a string instrument, is pure chance, and borrowing from Germanic into Gallo-Romance seems more plausible than the reverse direction (despite the unexplained voicing of initial  f ). Medieval Latin  vitula, vidula  (best attested in English documents) are not necessarily indicative of an earlier Gallo-Romance form of  viola,  as the Germanic etymon may have contaminated the Romance word. There is no likely relation between the Medieval Latin words and Latin  V\u012btula  \"goddess of joy,\"  v\u012btul\u0101r\u012b  \"to utter a cry of exultation,\" which should have developed quite differently in Romance.",
