		"notes": "A Brief History of the Verb  Vet Verb  When we  vet  a statement for accuracy or  vet  a candidate for a position, what are we doing, literally?  Does the verb have something to do with  veteran  \"a person with long experience,\" perhaps indicating that the thing or person vetted is proved to be tried and true?  Interestingly, the word is not related to  veteran  at all, but rather to  veterinarian  \"an animal doctor.\"That noun was shortened to  vet  by the mid-19th century and, within decades, gave rise to a verb  vet  meaning \"to subject (an animal) to medical examination.\"  The verb was soon applied to human beings as well, broadening in sense to \"to perform a medical checkup on.\"  By the early 20th century, this word took on the figurative meaning that is now most familiar: \"to subject a person or thing to scrutiny; to examine for flaws.\"",
