		"examples": [],
		"notes": "Did You Know? If you happen to be afflicted with lycanthropy, the full moon is apt to cause you an inordinate amount of distress. \"Lycanthropy\" can refer to either the delusional idea that one is a wolf or to the werewolf transformations that have been the stuff of superstitions for centuries. In some cultures, similar myths involve human transformation into other equally feared animals: hyenas and leopards in Africa, for example, and tigers in Asia. The word  lycanthropy  itself, however, comes from the Greek words  lykos,  meaning \"wolf,\" and  anthropos,  meaning \"human being.\" Werewolf myths are usually associated with the phases of the moon; the animal nature of the werewolf (or \"lycanthrope\") is typically thought to take over when the moon is full.",
