		"notes": "Lugubrious  Has Latin Roots It is a consolation to the wretched to have companions in misery, wrote Publilius Syrus in the first century BC. Perhaps this explains why \"lugubrious\" is so woeful-it's all alone. Sure, we can dress up \"lugubrious\" with suffixes to form \"lugubriously\" or \"lugubriousness,\" but the word remains essentially an only child-the sole surviving English offspring of its Latin ancestors. This wasn't always the case, though. \"Lugubrious\" once had a linguistic living relative in \"luctual,\" an adjective meaning \"sad\" or \"sorrowful.\" Like \"lugubrious,\" \"luctual\" traced ultimately to the Latin verb  lug\u0113re,  meaning \"to mourn.\" \"Luctual,\" however, faded into obsolescence long ago, leaving \"lugubrious\" to carry on the family's mournful mission all alone.",
