		"notes": "Shine a Light on the Origin of  Lucid It's easy enough to shed some light on the origins of  lucid : it derives\u2014via the Latin adjective  lucidus , meaning \"shining\"\u2014from the Latin verb  luc\u0113re , meaning \"to shine.\"  Lucid  has been used by English speakers since at least the late 16th century. Originally, it meant merely \"filled with light\" or \"shining,\" but it has since developed extended senses describing someone whose mind is clear or something with a clear meaning. Other shining examples of  luc\u0113re  descendants include  translucent ,  lucent  (\"glowing\"), and the somewhat rarer  relucent  (\"reflecting light\" or \"shining\"). Even the word  light  itself derives from the same ancient word that led to  luc\u0113re .",
