		"etymology": "History and Etymology for  Lolita  from  Lolita , character in the novel  Lolita  (1955) by Vladimir Nabokov",
		"examples": [],
		"notes": "Lolita English has a good number of  eponyms , words taken from the name of a real or imaginary person. In some cases, particularly when the word is drawn from the name of a fictional character, it may take on or discard meanings, as when  Romeo  is used to simply mean \u201ca male lover,\u201d with no hint at the tragedy the character faces in Shakespeare\u2019s play. Similarly  Frankenstein  has become for some so disassociated from the name of the doctor who created the monster that we provide the definition \u201ca monster in the shape of a man.\u201d  In some cases it can be disconcerting when an eponym strays in meaning. In Vladimir Nabokov\u2019s 1955 novel,  Lolita , the character Lolita is a child who is sexually victimized by the book\u2019s narrator. The word  Lolita  has, however, strayed from its original referent, and has settled into the language as a term we define as \u201ca precociously seductive girl.\u201d This definition is based on a considerable body of evidence of the word as it is used in published English prose; it is not intended to be a lexicographic reflection of Nabokov\u2019s creation.  The story goes like this: a would-be pop star and Hispanic Lolita from the mean streets of Hell's Kitchen, hungry for fame and hoping to crash the Big Time, takes the D train from Manhattan to East Flatbush in Brooklyn. There she is greeted by an intimidating band of streetwise black musicians\u2014Full Force, they call themselves. They're holding an audition for a singer to record: they want someone \"with the eyes of a woman and the temperament of a girl.\" Loving her style, the band cuts a song with the teenager\u2014\"Lisa Lisa\" they decide to call her. The record is a hit. Presto: a new star is born! \u2014 Jim Miller, et al.,  Newsweek , 22 June 1987  Before  Clueless  hit two years ago, the press had already begun sniping: Citing her video-laden r\u00e9sum\u00e9, an  Entertainment Weekly  cover sneered, A STAR IS MADE. Then Silverstone confounded everyone, leapfrogging from low-rent cult Lolita to bona fide actress. \u2014 David Handelman,  Premiere , August 1997  As the woebegone heroine, Clara, the Bourne veteran Etta Murfitt gives a performance that tugs the heartstrings. Anjali Mehra is equally effective as the snotty, selfish Sugar, a veritable Lolita in crinolines. \u2014 Allen Robertson,  The Times  (London), 6 Dec. 2003 The definition of  Lolita  reflects the fact that the word is used in contemporary writing without connotations of victimization. Words often depart in meaning from the meanings of their sources, and this is as true for those which have come from names as it is for those which have sprung from less easily identified origins.",
