		"notes": "Did You Know? Loll  has origins similar to those of another soothing verb,  lull , which means \"to cause to rest or sleep.\" Both words can be traced back to 14th-century Middle English and probably originated as imitations of the soft sounds people make when resting or trying to soothe someone else to sleep.  Loll  has also been used in English as a noun meaning \"the act of lolling\" or \"a relaxed posture,\" but that use is now considered archaic. In its \"recline\" or \"lean\" sense,  loll  shares synonyms with a number of \"l\" verbs, including  loaf ,  lounge , and  laze .",
