		"synonym_discussion": "Choose the Right Synonym for  loll Verb  idle ,  loaf ,  lounge ,  loll ,  laze  mean to spend time doing nothing.  idle  may be used in reference to persons that move lazily or without purpose.idled  the day awayloaf  suggests either resting or wandering about as though there were nothing to do.she does her work and then  loafs  the rest of the day lounge , though occasionally used as equal to  idle  or  loaf , typically conveys an additional implication of resting or reclining against a support or of physical comfort and ease in relaxation.he  lounged  against the wall loll  also carries an implication of a posture similar to that of  lounge , but places greater stress upon an indolent or relaxed attitude.lolling  on the couchlaze  usually implies the relaxation of a busy person enjoying a vacation or moments of leisure.lazed  about between appointments",
