		"etymology": "History and Etymology for  Locofoco  after  locofoco , trade name of a cigar or match lit by friction, perhaps from  loco-  (in  locomotive  entry  1 , taken to mean \"self-moving\") +  -foco , altered from Italian  fuoco  or Spanish  fuego  \"fire\" (going back to Latin  focus  \"hearth\"); the political group allegedly named from a meeting held at Tammany Hall, New York, on Oct. 29, 1835, at which friction matches were used to light candles after the gaslights were turned off by the group's opponents  \u2014 more at  focus  entry  1",
		"examples": [],
		"notes": "Did You Know? Locofoco  burned brightest in 19th-cenutry America, where it designated a new type of self-igniting match or cigar capable of being lit by friction on a hard surface. The word is believed to combine the adjective  locomotive  (which was commonly taken to mean \"self-propelled,\" though  loco  actually means \"place,\" not \"self,\" in Latin) and the Italian word for \"fire,\"  fuoco.  The political meaning of  Locofoco  is a story in itself. In 1835, a group of radical Democrats brought locofoco matches to one of their meetings after hearing that their adversaries were plotting to disrupt the meeting by putting out the gas lights. The room did indeed go black but was soon relit, thus earning the group its name.",
